css:
.file-results-filename {
  cursor: pointer;
  display: block;
  overflow-x: hidden;
  white-space: nowrap;
  line-height: 25px;
}
.file-results-filename:hover {
  color: #d7dae0;
}
.file-results-filename .icon {
  text-align: center;
  vertical-align: middle;
}
.file-results-snippet:last-child {
  border-bottom: 1px solid #181a1f;
  margin-bottom: 8px;
}
.file-results-snippet {
  border-top: 1px solid #181a1f;
  display: flex;
  position: relative;
}
.file-results-line-numbers,
.file-results-code {
  display: inline-block;
  font-family: Menlo, Monaco, Consolas, monospace;
  line-height: 25px;
  white-space: pre;
}
.file-results-line-numbers {
  background: #282c34;
  box-sizing: content-box;
  color: #636d83;
  cursor: pointer;
  min-width: 3em;
  padding-left: 4em;
  text-align: left;
  -webkit-user-select: none;
}
.file-results-line-numbers > div:hover {
  color: #abb2bf;
}
.file-results-code {
  background: #282c34;
  color: #abb2bf;
  flex: 1;
  overflow-x: hidden;
  position: relative;
  tab-size: 8;
}
.file-results-code .highlight-info {
  /* Copied from find-and-replace */
  box-shadow: inset 0 0 1px #f5fafe;
  cursor: pointer;
  padding: 1px 0;
}
.file-results-code .highlight-info:hover {
  text-decoration: underline;
}
.file-results-code:hover {
  overflow-x: auto;
}
.file-results-highlights {
  left: 0;
  position: absolute;
  top: 0;
  z-index: 1;
}
